import React, { useEffect, useState } from 'react';
import { FaFilePrescription, FaCalendarAlt, FaUserMd, FaPills, FaStickyNote } from 'react-icons/fa';
import jsPDF from 'jspdf';

const MesOrdonnances = () => {
  const [ordonnances, setOrdonnances] = useState([]);
  const token = localStorage.getItem('token');
  const patientId = localStorage.getItem('patient_id');
  

  const handleDownloadPdf = (ordonnance) => {
    const doc = new jsPDF();
  
    // Ton logo en base64 (remplace-le par le tien)
    const logoBase64 = "data:image/png;base64,"; // colle ici ton vrai base64
  
    // Ajouter le logo
    doc.addImage(logoBase64, 'PNG', 10, 10, 40, 20); // x, y, width, height
  
    // Titre
    doc.setTextColor(40, 40, 40);
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(20);
    doc.text('Ordonnance Mdicale', 105, 20, { align: 'center' });
  
    // Ligne de sparation
    doc.setLineWidth(0.5);
    doc.line(20, 30, 190, 30);
  
    // Contenu
    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');
  
    let y = 45;
  
    doc.text(`Date de prescription : ${ordonnance.date_prescription}`, 20, y);
    y += 10;
    doc.text(`Mdecin : Dr. ${ordonnance.medecin.nom} ${ordonnance.medecin.prenom}`, 20, y);
    y += 10;
  
    doc.setFont('helvetica', 'bold');
    doc.text('Mdicaments :', 20, y);
    y += 8;
  
    doc.setFont('helvetica', 'italic');
    doc.text(doc.splitTextToSize(ordonnance.contenu || 'Non spcifi', 160), 25, y);
    y += 15;
  
    if (ordonnance.commentaire) {
      doc.setFont('helvetica', 'normal');
      doc.text(' Commentaire :', 20, y);
      y += 8;
      doc.setFont('helvetica', 'italic');
      doc.text(doc.splitTextToSize(ordonnance.commentaire, 160), 25, y);
      y += 15;
    }
  
    // Footer
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    doc.setTextColor(150);
    doc.text('Gnr via le portail sant', 105, 285, { align: 'center' });
  
    // Tlcharger
    doc.save(`ordonnance-${ordonnance.id}.pdf`);
  };
  
  


  useEffect(() => {
    const fetchOrdonnances = async () => {
      try {
        const response = await fetch(`http://localhost:8000/api/ordonnances/patient/${patientId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
            Accept: 'application/json',
          },
        });

        if (!response.ok) throw new Error('Erreur lors du chargement des ordonnances');
        const data = await response.json();
        setOrdonnances(data);
      } catch (error) {
        console.error(error.message);
      }
    };

    fetchOrdonnances();
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>
        <FaFilePrescription style={styles.iconTitle} /> Mes Ordonnances
      </h2>
      <div style={styles.cardContainer}>
        {ordonnances.length === 0 ? (
          <p style={styles.message}>Aucune ordonnance disponible.</p>
        ) : (
          ordonnances.map((ordonnance) => (
            <div key={ordonnance.id} style={styles.card}>
              <p><FaCalendarAlt style={styles.icon} /> <strong>Date :</strong> {ordonnance.date_prescription}</p>
              <p>
                <FaUserMd style={styles.icon} /> 
                <strong>Mdecin :</strong> Dr. {ordonnance.medecin.nom} {ordonnance.medecin.prenom}
              </p>
              {ordonnance.medecin.photo && (
                <img
                  src={ordonnance.medecin.photo.replace('storage/http://127.0.0.1:8000/storage/', 'storage/')}
                  alt="Mdecin"
                  style={styles.image}
                />
              )}
              <p><FaPills style={styles.icon} /> <strong>Contenu :</strong> {ordonnance.contenu}</p>
              {ordonnance.commentaire && (
                <p><FaStickyNote style={styles.icon} /> <strong>Commentaire :</strong> {ordonnance.commentaire}</p>
              )}
                <button onClick={() => handleDownloadPdf(ordonnance)} style={styles.button}>
                Tlcharger (.pdf)
                </button>

            </div>
            
          ))
        )}
      </div>
    </div>
  );
};

const styles = {
  container: {
    backgroundColor: '#f4f9ff',
    minHeight: '100vh',
    padding: '40px 20px',
    fontFamily: 'Arial, sans-serif',
  },
  title: {
    fontSize: 28,
    color: '#2c3e50',
    textAlign: 'center',
    marginBottom: 30,
  },
  iconTitle: {
    marginRight: 10,
    color: '#007bdb',
  },
  cardContainer: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
    gap: 20,
    padding: '0 10px',
  },
  card: {
    backgroundColor: '#fff',
    padding: 20,
    borderRadius: 10,
    boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
    borderLeft: '5px solid #007bdb',
  },
  icon: {
    marginRight: 8,
    color: '#007bdb',
  },
  image: {
    width: 60,
    height: 60,
    borderRadius: '50%',
    margin: '10px 0',
    objectFit: 'cover',
  },
  message: {
    textAlign: 'center',
    color: '#888',
    fontSize: 18,
  },
  button: {
    backgroundColor: '#007bdb',
    color: '#fff',
    padding: '8px 12px',
    border: 'none',
    borderRadius: 5,
    cursor: 'pointer',
    marginTop: 10,
  }
  
};

export default MesOrdonnances;
